webpackJsonp([49,262],{13:function(e,t){e.exports="data:image/png;base64,"},1045:function(e,t,r){e.exports={frontmatter:r(426),content:r(1647)}},1647:function(e,t,r){e.exports='<link rel=stylesheet href=http://cdn.leafletjs.com/leaflet/v0.7.7/leaflet.css /> <script src=http://cdn.leafletjs.com/leaflet/v0.7.7/leaflet.js></script> <script src=leaflet-image.js></script> <section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <figure>Her kan du laste ned kart som passer å bruke som bakgrunner i Scratch-prosjektene dine.</figure> <div style=margin:auto;width:480px> <div id=kart style=width:480px;height:360px></div> <p> <br/> <a id=last_ned_som_bilde class="btn btn-default btn-lg btn-block">Last ned som Scratch-bakgrunn</a> </p> </div> </section> <section class=activity id=hvordan-bruke-kartene-i-scratch> <h1 class=activity id=hvordan-bruke-kartene-i-scratch>Hvordan bruke kartene i Scratch</h1> <p><em>For å bruke et av disse kartene i Scratch må du først laste det ned til datamaskin som en bildefil. Deretter laster du bildefilen opp som en bakgrunn i Scratch.</em></p> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <ul> <li> <p>Velg kartutsnitt ved å klikke og dra i kartet. Du kan forstørre og forminske kartet med <img src='+r(2289)+" alt=+ /> og <img src="+r(2288)+" alt=- />-knappene.</p> </li> <li> <p>Velg utseende på kartet fra listen som dukker opp når du peker på <img src="+r(2287)+" alt=kartlag /> i nedre høyre hjørne.</p> </li> <li> <p>Klikk på <strong>Last ned som Scratch-bakgrunn</strong>.</p> </li> </ul> <p>Dette vil laste ned kartet til datamaskinen din som en bildefil. Om du ikke får velge filnavn selv vil bildefilen hete <code>kart.png</code> og sannsynligvis ligge i en katalog som heter <code>Nedlastinger</code>.</p> <p>Nå skal vi se hvordan vi legger inn kartet som en bakgrunn i Scratch.</p> <ul> <li> <p>Åpne et Scratchprosjekt hvor du vil bruke kartet.</p> </li> <li> <p>Klikk på <img src="+r(13)+' alt="Last opp bakgrunn fra fil"/> nederst til venstre for å laste opp en ny bakgrunn fra fil.</p> </li> <li> <figure>Velg filen <code>kart.png</code> som du nettopp lastet ned.</figure> </li> </ul> <figure>Kartet skal nå dukke opp som en bakgrunn i prosjektet ditt. Om du ønsker kan du alternativt bruke kartet som en figur.</figure> </section> <section class=tip id=opphavsrett> <h2 class=tip id=opphavsrett>Opphavsrett</h2> <p>Kartene du laster ned fra denne siden kan du fritt bruke som du vil. Men de som har laget kartene ønsker at du forteller at du bruker kartene deres. Om du titter i nederste høyre hjørne av kartgeneratoren (ikke det ferdige kartet) vil du se at det står navnet på dem som har laget det (Kartverket, OpenStreetMap, Stamen eller Thunderforest). Dette må du nevne om du legger ut prosjektet ditt.</p> <p>Dette er lett å gjøre i Scratch. Klikk på <code>Se prosjektsiden</code> øverst til høyre. Du kommer da til en side hvor du kan beskrive prosjektet. En av boksene heter <code>Merknader og bidragsytere</code>. Her kan du nevne dem som opprinnelig har laget kartet, og at du har lastet det ned fra denne nettsiden.</p> <script src=kart.js></script> </section> </section>'},2287:function(e,t){e.exports="data:image/png;base64,"},2288:function(e,t){e.exports="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABEAAAAQCAYAAADwMZRfAAAABmJLR0QA/wD/AP+gvaeTAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAB3RJTUUH4AUfFjkG5UaO1gAAAEpJREFUOMtj/P///38GCgETAxXAqCGYgAVd4NGjRwyTJk3CqaGkpIRBQkICVfA/Gjh+/Ph/BgYGnPjy5cvoWv4PnjBhHE2xg9gQAOW6O7zC+F3YAAAAAElFTkSuQmCC"},2289:function(e,t){e.exports="data:image/png;base64,"}});